import React from 'react';
import contact from './css/contact.css';

class Contact extends React.Component {
  render() {
    return(
      <section id="contact-us">
        <div class="enclosed-container">
          <h2> Contact Us </h2>
          <div class="contact-info">

          </div>
        </div>
      </section>
    );
  };
};

export default Contact;
